import React from 'react';
import { Link } from 'react-router-dom';
import Image from '../img/plantlogo.jpg'
import { Avatar, Button } from 'antd';

const Navigation = () => {
  return (
    <>
      <nav id='navigation'>
        <div id='navBar' href='#home'>
          <img id='logopic' src={Image} 
          />
        </div>

          <div>
            <Link to='/login'>
              <Button>Login</Button>
            </Link>

            <Link to='/signup'>
              <Button>Sign Up</Button>
            </Link>
          </div>

          {/* <div>
            <Link to='/signup'>
              <Button>Sign Up</Button>
            </Link>
          </div> */}

      </nav>
    </>
  );
};
export default Navigation;
